<!DOCTYPE html>

<head>
  <meta charset="UTF-8">
  <title>Cereri disponibile</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      background: #f4f4f4;
      margin: 0;
      padding: 0;
    }

    header, footer {
      background-color: #0077cc;
      color: white;
      text-align: center;
      padding: 15px;
    }

    h1 {
      margin: 20px 0;
      color: #0077cc;
      text-align: center;
    }

    .container {
      display: flex;
      flex-wrap: wrap;
      justify-content: center;
      gap: 30px;
      padding: 40px 20px;
    }

    .card {
      background: white;
      border-radius: 10px;
      box-shadow: 0 2px 5px rgba(0,0,0,0.1);
      text-align: center;
      width: 220px;
      padding: 20px;
      transition: transform 0.3s;
    }

    .card:hover {
      transform: translateY(-5px);
    }

    .card img {
      width: 100px;
      height: 100px;
      object-fit: contain;
      margin-bottom: 15px;
    }

    .card h3 {
      margin: 10px 0;
      font-size: 16px;
      color: #333;
    }

    .card a {
      display: inline-block;
      margin-top: 10px;
      background: #0077cc;
      color: white;
      padding: 8px 14px;
      border-radius: 5px;
      text-decoration: none;
      font-weight: bold;
    }

    .card a:hover {
      background: #005fa3;
    }
  </style>
</head>
